findStrings.find:
Dimension dimension \= appiumDriver\.manage\(\)\.window\(\)\.getSize\(\)\;
 int fromX \= 0\;
 int fromY \= 0\;
 int endX \= 0\;
 int endY \= 0\;
 switch \(direction\)\{
 case UP\:
 fromX \= \(dimension\.getWidth\(\)\)/2\;
 fromY \= \(dimension\.getHeight\(\)\)\-700\;
 endX \= \(dimension\.getWidth\(\)\)/2\;
 endY \= 100\;
 System\.out\.print\("Scroll\: "\+fromX\+"\-"\+fromY\+"\;"\+endX\+"\-"\+endY\)\;
 \(new TouchAction\(appiumDriver\)\)
 \.press\(PointOption\.point\(fromX\,fromY\)\)
 \.waitAction\(WaitOptions\.waitOptions\(Duration\.ofMillis\(1000\)\)\)
 \.moveTo\(PointOption\.point\(endX\, endY\)\)
 \.release\(\)
 \.perform\(\)\;
 break\;

 case RIGHT\:
 fromX \= \(int\)\(\(dimension\.getWidth\(\)\)\*0\.9\)\;
 fromY \= \(dimension\.getHeight\(\)\)\-200\;
 endX \= \(int\)\(\(dimension\.getWidth\(\)\)\*0\.05\)\;
 endY \= \(dimension\.getHeight\(\)\)\-200\;
 System\.out\.print\("Scroll\: "\+fromX\+"\-"\+fromY\+"\;"\+endX\+"\-"\+endY\)\;
 \(new TouchAction\(appiumDriver\)\)
 \.press\(PointOption\.point\(fromX\,fromY\)\)
 \.waitAction\(WaitOptions\.waitOptions\(Duration\.ofMillis\(1000\)\)\)
 \.moveTo\(PointOption\.point\(endX\, endY\)\)
 \.release\(\)
 \.perform\(\)\;
 break\;
 \}
